import { BrowserRouter, Route, Routes } from "react-router-dom";
import App from "./components/App";
import MainMarket from './pages/MainMarket'

function MainRender() {
  return (
    <BrowserRouter>
      <App>
        <Routes>
        <Route />
        <MainMarket />
        </Routes>
      </App>
    </BrowserRouter>
  );
}

export default MainRender;
